import React from 'react'
import { NoviceDetail } from './NoviceDetail'
import { nproducts } from './novicedeets'
function Novice() {

    return (
        <div className='md-3'>
            {nproducts.map((nproduct) => (
                <NoviceDetail nproduct={nproduct} />
            ))}
        </div>
    )
}

export default Novice
